import { getByDisplayValue } from '@testing-library/react';
import React from 'react';
import './Contacts.css'

function Contacts(){

    let conteudo='contactos';

function Change(){
    if(document.getElementById("demo").innerText= 'contactos'){
         conteudo='9185541777'
    }
    else{
        conteudo='outro numero'
    }
    }


    return(

        <div className='Contacts' >

    <button id='demo' onMouseOver={Change}>{conteudo}</button>

        </div>

    )
}

  export default Contacts;
